import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { Container, Col, Row} from "react-bootstrap";
export default function App() {
  return (
    <Container>
      <Row className="header bg-primary mb-1 text-white">HEARER</Row>
      <Row className="sec1 mt-1">
        <Col md={6} className="bg-warning p-2" id="muc1">MUC 1</Col>
        <Col md={3} className="bg-light p-3" id="muc2">MUC 2</Col>
        <Col md={3} className="bg-info p-3" id="muc3">MUC 3</Col>
      </Row>
      <Row className="sec2 mt-1">
          <Col sm={9} className="bg-info" id="maindata">MAIN</Col>
          <Col sm={3} className="bg-dark" id="ttbosung">THÔNG TIN BỔ SUNG</Col>
      </Row>
      <Row className="footer my-1 bg-dark text-white">
          <Col md={4} className="bg-dark" id="footer1">footer 1</Col>
          <Col md={4} className="bg-warning" id="footer2">footer 2</Col>
          <Col md={4} className="bg-info" id="footer3">footer 3</Col>
      </Row>
    </Container>
  );
}
